import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import logo from "./Images/logo.png";
import Image from "react-bootstrap/Image";
import { LinkContainer } from "react-router-bootstrap";

const NavbarComponent = () => {
  return (
    <Container classname="Navigation">
      <Image src={logo} className="logo" />
      <Navbar>
        <Container>
          <Nav className="NavBar">
            <Nav.Link to="/">Home</Nav.Link>
            <LinkContainer to="/scheduleComponenet"></LinkContainer>
            <Nav.Link >Schedule</Nav.Link>
            <Nav.Link to="learningComponent">Learning</Nav.Link>
            <Nav.Link to="profileComponent">Profile</Nav.Link>
            <Nav.Link to="pricing">Notification</Nav.Link>
            <Nav.Link to="loginComponent">Login in</Nav.Link>
            <Nav.Link to="signupComponenet">Sign Up</Nav.Link>
          </Nav>
        </Container>
      </Navbar>
    </Container>
  );
};

export default NavbarComponent;
